import React, { useState, useEffect } from "react";
import axios from "axios";

const Component1 = () => {
  const [data, setData] = useState("");
  const [loading, setLoading] = useState(true);
  const [returnedData, setReturnedData] = useState("");
  let part = 1;
  let returnedValue = "";

  const checkNotEmptyUndefinded = (value) => {
    if (value === undefined || value === null || value === "") {
      return false;
    }
    return true;
  };

  let config = {
    method: "get",
    url: `http://localhost:8080/part?id=${part}`,
    headers: {},
  };
  useEffect(() => {
    axios(config)
      .then(function (response) {
        setData(response.data);
        setLoading(false);
      })
      .catch(function (error) {
        console.log(error);
      });
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  const isObject = (value) => {
    if (value === null) {
      return false;
    }
    return typeof value === "object";
  };

  const objProps = (obj, i) => {
    if (!i) i = 0;
    for (let val in obj) {
      if (Array.isArray(obj[val])) {
        obj[val].forEach((e) => {
          if (isObject(e)) {
            i++;
            objProps(e, i);
          } else {
            console.log("EEEEEEE", e);
          }
        });
      } else if (isObject(obj[val])) {
        console.log("i:", i, val.toUpperCase());
        if (Object.keys(obj[val]).length) {
          i++;
          objProps(obj[val], i);
        }
      } else {
        if (checkNotEmptyUndefinded(obj[val])) console.log(val, obj[val]);
      }
    }
  };

  const objProps2 = (obj, i = 0) => {
    for (let val in obj) {
      if (isObject(obj[val])) {
        console.log("i:", i, val.toUpperCase());
        if (Object.keys(obj[val]).length) {
          i++;
          objProps(obj[val], i);
        }
      } else if (Array.isArray(obj[val])) {
        obj[val].forEach((e) => {
          if (isObject(e)) {
            i++;
            objProps(e, i);
          } else {
            console.log("EEEEEEE", e);
          }
        });
      } else {
        if (checkNotEmptyUndefinded(obj[val])) console.log(val, obj[val]);
      }
    }
  };

  // Create a function that takes an object and returns a table of its properties and values.
  const JsonTableComponent = (obj) => {
    let table = "";
    for (let val in obj) {
      if (isObject(obj[val])) {
        table += `<tr><td>${val}</td><td>${JsonTableComponent(
          obj[val]
        )}</td></tr>`;
      } else if (Array.isArray(obj[val])) {
        table += `<tr><td>${val}</td><td>${JsonTableComponent(
          obj[val]
        )}</td></tr>`;
      } else {
        table += `<tr><td>${val}</td><td>${obj[val]}</td></tr>`;
      }
    }
    return `<table>${table}</table>`;
  };

  // const JsonTableComponent = (json) => {

  if (Object.keys(data).length) {
    objProps(data);

    // returnedValue = JsonTableComponent(data);

    // console.log("returnedValue:", returnedValue);
  }

  return (
    <>
      {loading ? (
        <div>Loading...</div>
      ) : (
        <div>
          <div>{<JsonTableComponent data={data} />}</div>
        </div>
      )}
    </>
  );
};
